import React, { useState } from "react";
import Navbar from "./Navbar";

function Contact() {

  const [value, setvalue] = useState(false)

  const funcclick = () => {
    setvalue(true);
  }
  return (
    <>
      <Navbar />
      <h1>Full Contactus Page</h1>
      <button onClick={funcclick}>Click It</button>
      <div>
      {value}
      </div>
    </>
  );
}

export default Contact;
